import {getAllStudy} from '../studies';
import '../components/studies/Studies.css'
function Studies(){
    const studies=getAllStudy();
    return(
        <div>
            <div className='box-studies'>
                <h1>Studies</h1>
                <div className='list-studies'>
                    {studies.map(studies=>
                    <div>
                         {studies.institucion}</div>
                    
                        )}
                </div>
            </div>
            
        </div>
    );
}
export default Studies;
